import React from 'react';
import { Container, Grid } from '@material-ui/core';
import Post from './Post/Post';
import {Button, Card} from 'react-bootstrap'; 



const Posts = () => {
    const imgSrc = "/client/public/logo512.png";
    return (
        <Grid>
        <Container>
            <h1>Posts: The item to be displayed</h1>
            <Card style ={{width: "18rem"}}>
                <Card.Img variant="top" src="https://akm-img-a-in.tosshub.com/indiatoday/images/story/202008/Share_Multiple_Photos_and_Vide.jpeg?unoTzeJwAg_xbBQ0tXg8pxV5A5sl1VEO&size=770:433" />
                <Card.Body>
                    <Card.Title>Post Name</Card.Title>
                    <Card.Body>
                        SomeQuick Example Test Description
                    </Card.Body>

                </Card.Body>
            </Card>
            <Post imageSource={imgSrc}/>
        </Container>
        </Grid>
    );
};

export default Posts;
